<script type=""text/javascript"">
	$(document).ready(function () {

		//change attribute number on click
		$('.changeAttributeNumberBtn').click(function (event) {
			event.preventDefault();

			$container = $(this).closest('.changeAttributeNumber');

			$value = $container.find('.changeAttributeNumberValue').val();

			$link = $container.find('.changeAttributeNumberUrl').val();

			window.location.replace($link + '&productAttributesNumber=' + $value);
		});

		function isNullOrSpaces(str){
			return str === null || str.match(/^ *$/) !== null;
		}

		//update attributes
		$('.updateAttributesForm').submit(function (event) {
			event.preventDefault();

			let attributes = {};

			let valuesArrays = [];

			$('.attributeValues').each(function (index, element) {
				valuesArrays.push($(this).tagsinput('items'));
			});
			
			let count = 0;
			$('.attributeKey').each(function (index, element) {
				if (!isNullOrSpaces($(this).val())) {
					attributes[$(this).val()] = valuesAr");
            WriteLiteral(@"rays[count];
				}
				count++;
			});

			if (!jQuery.isEmptyObject(attributes)) {
				let $form = $(this);
				$.ajax({
					url: $form.attr('action'),
					type: 'post',
					data: {
						serializedUpdateViewModel: JSON.stringify({
							SellerId: $(""#sellerId"").val(),
							ProductTypeId: $('#productTypeId').val(),
							Attributes: attributes
						})
					},
					success: function (result) {
						if (typeof result !== 'undefined' && result.length > 0) {
